import useTweets from "../hooks/useTweets";

export const HomePage = () => {
  const { tweets, loading, error } = useTweets();

  if (loading) return <p>Cargando Tweets</p>;
  if (error) return <p>{error}</p>;

  return (
    <section>
      <h1>Ultimos tweets</h1>
      <p>Lista de tweets</p>
    </section>
  );
};

export default HomePage;
